	(100, '2023-08-17 09:38:08.107359', '2023-08-18 02:55:42.142519', '사진에 보이는 연구개에 집중해주세요.\n\n연구개가 하늘에 닿는다는 느낌으로 혀에 힘을 빼보세요.\n\n비강이 일정하게 떨린다면 성공입니다!', NULL, 16, 0, '음색 조절하는 꿀팁 공유해요', 27),
