INSERT INTO `script_line` (`id`, `content`, `end_sec`, `start_sec`, `casting_id`) VALUES
	(1, '야, 언제 나간다고?', 25, 0, 1),
	(2, '안 나가. 집주인한테 전세금 다시 줬어. 재개발돼서 나가라고 할 때까지 버티고 버텨야 한다고. 어휴 그 적금 외국 유학 가려고 모아둔 돈인데', 147, 26, 2),
	(3, '야 여기서 하면 되지 공부 뭐', 180, 148, 1),
	(4, '그 미소는 뭐니', 210, 182, 2),
	(5, '나랑 놀아줄 사람이 생겨서 신난다는 미소?', 252, 220, 1),
	(6, '나 진짜 빡세게 공부할거야ㅎㅎ, 좀 더 성장하고 좀 더 깊어져서,, 연봉 세게 받는 회사 갈거라고', 337, 253, 2),
	(7, '너 시간 방해 안 할테니까,, 빡세게 공부한 이후엔 나한테 시간좀 내줄래?', 400, 340, 1),
	(8, '시간을 내주고 말고 할게 뭐 있어~ 친구 사이에', 438, 402, 2),
	(9, '친구말고 연인으로,,', 460, 439, 1),
	(10, '아 못알아 들으니 다시 말씀드릴게요. 크리스토프가 당신 애인이 될거에요. 한스는 배신때리거든요', 133, 66, 3),
	(11, '그게 무슨말이야?', 153, 135, 4),
	(12, '으흠~~?', 178, 155, 3),
	(13, '한스가 배신을 때린다니?', 208, 185, 4),
	(14, '지금 스포해주는거에요~', 237, 210, 3),
	(15, '오! 그래 고마워, 계속 말해줄래?', 258, 239, 4),
	(16, '헤헤헤 성에가면 엘사가 당신을 공격할거에요', 285, 260, 3),
	(17, '말도안돼~', 298, 286, 4),
	(18, '우웅~ 근데 사실인데~', 318, 299, 3),
	(19, '어떡해..', 330, 320, 4),
	(20, '당신은 진정한 사랑을 찾겠지만 한스는 아니에요~ 으악! 그리고 크리스토픈줄 알겠지만 제걸이지롱~', 402, 332, 3),
	(21, '올라프 그럼 대체 진정한 사랑은 누군데?', 428, 403, 4),
	(22, '궁금해요?', 438, 430, 3),
	(23, '당연하지! 알려줘', 449, 439, 4),
	(24, '그럼 뭐해줄건데요?', 461, 450, 3),
	(25, '맞고말할래? 그냥말할래?', 477, 462, 4),
	(26, '알았어요~', 487, 479, 3),
	(27, '난 때리겠지 뭐 으악!', 496, 488, 5),
	(28, '당신은 언니가 한스한테 칼빵맞는거 보고 얼음을 댈거에요', 532, 498, 3),
	(29, '한스는 실은 왕될라고 연기하는 거거든', 562, 533, 5),
	(30, '그리고 결말은~ 언니는 당신을 보고 울고~ 껴안고~ 그리고 마법이 풀리면서~ 겨울이 물러가고~~ 영화는 해피엔딩~~', 668, 570, 3),
	(31, '그리고 내가 아렌델 정식 얼음장수라는 것도 말해야지!', 705, 669, 5),
	(32, '좋겠수!', 717, 707, 3),
	(33, '헤어져요', 15, 0, 6),
	(34, '너 지금 진심이야?', 40, 23, 7),
	(35, '네, 진짜 너랑 못 사귀겠어요', 74, 41, 6),
	(36, '너 말 다했어? 네가 휴대폰 잃어버린 게 내 탓이야? 어?', 132, 83, 7),
	(37, '맞다면 우리가 이렇게 맨날 싸울 리가 없잖아', 170, 133, 6),
	(38, '헤어져?', 178, 171, 7),
	(39, '결국 못찾아 줬잖아요 거기에 거래처 전화랑 메모랑 다 있는데 오감 능력자 때가 좋았다, 진짜 아니, 무슨 휴대폰 하나를 못 찾고 3시간을 내내', 282, 180, 6),
	(40, '내가 그걸 다 어떻게 찾아? 내가 개냐? 개야? 멍멍멍!', 327, 283, 7),
	(41, '예전엔 그렇게 철두철미하더니 사람이 아주 맛탱이가 갔어 맛탱이가', 380, 328, 6),
	(42, '그럼 너도 휴대폰 간수 잘하게 미래라도 보시지, 왜? 어? 그냥 말을 해 너 휴대폰 때문에 짜증 난 거 아니잖아. 너 내가 아까 거래처 윤 대리랑 잠깐 얘기했다고 이러는 거잖아!', 497, 382, 7),
	(43, '아, 잠깐 얘기를 그렇게 눈웃음 흘리면서 하셨어요? 어젯밤에도 톡 하셨잖아요, 몰래', 578, 500, 6),
	(44, '그, 업무상 주고받은 거뿐이야', 609, 580, 7),
	(45, '업무상 주고받은 걸 왜 8시가 넘어서 그리고 그 윤대리는, 어? 왜 눈웃음을, 어? 이렇게 톡마다 처 하냐고요', 695, 610, 6),
	(46, '뭐, 마지막 사랑, 운명 어쩌고저쩌고 하더니 맨날 말도 안되는 걸로 시비야!', 755, 700, 7),
	(47, '나도 지긋지긋하거든요? 나도 이따위 거지것은 연애 처음이에요!', 805, 760, 6),
	(48, '뭐? 너 말 다했어? 후회 안하지?', 844, 807, 7),
	(49, '후회를 내가 왜 하냐? 참 ', 870, 850, 6),
	(50, '씨..', 875, 871, 7),
	(51, '잘못했어! 윤 대리 차단할게', 983, 950, 7),
	(52, '나도 미안요 심리 치료를 받아야 하나', 1060, 1022, 6),
	(53, '미안해, 잘못했어 집에 가자', 1091, 1068, 7),
	(54, '차단해', 1106, 1097, 6),
	(55, '어', 1112, 1107, 7),
	(56, '이봐~ 안녕? 잘 지냈어?', 70, 40, 8),
	(57, '아이고~ 뛰뛰 경찰이네.', 88, 71, 9),
	(58, '(웃는 호)아니. 난 주디 순경이야. 사건에 대해 몇가지 물어볼게 있는데 말이지.', 138, 90, 8),
	(59, '뭔데 주차단속원. 누가 신호등 부쉈냐? 내가 안했다~', 180, 140, 9),
	(60, '홍당무 아가씨, 아기 깨겠어. 나 출근해야 돼.', 241, 210, 9),
	(61, '정말 중요한 일이야! 그러니까 10달러 짜리 하드 장사는 조금 미뤄.', 286, 243, 8),
	(62, '난 돈을 꽤 벌어, 하루에 200달러 정도. 그리고 12살때부터 이 일을 365일 해왔어. 시간이 돈이야. 저리 비켜.', 370, 290, 9),
	(63, '주디:그냥 사진확인만 해줘~ 오터톤씨한테 하드 팔았지, 그치? 그를 알아?', 421, 371, 8),
	(64, '난 모두를 알아. 그리고 토끼인형은 장난감 가게에 있어야지, 돌아다니면 안된단것도 알지.', 496, 422, 9),
	(65, '알았어. 그럼 하는 수 없지 뭐.', 520, 498, 8),
	(66, '내 유모차에 뭔 짓을 한거야!', 550, 530, 9),
	(67, '니콜라스 와일드, 당신을 체포한다!', 572, 551, 8),
	(68, '(비웃는 호)무슨 죄로! 네 기분 거슬린 죄?', 599, 573, 9),
	(69, '탈세는 중범죄야. 보자~ 하루에 200달러, 1년 365일 내내 12살때부터 20년간이니까 곱하기 20하면 대충 계산해도 146만 달러쯤은 되는것 같네. 알겠지만 난 멍청한 토끼잖아? 근데 또 우리가 곱셈은 잘해요. 당신 납세를 보면 신고액이 어디보자~ 빵이네! 정말 안됐지만 이건 반드시 처벌을 받아야만 하는 중범죄에 속해. 5년이면 되겠는데?', 865, 600, 8),
	(70, '글쎄, 그 주장을 뒷받침 할 증거는?', 890, 868, 9),
	(71, '(녹음된 음성소리) 이러면 네 입으로 자백한 셈이지. 이 펜을 갖고 싶으면 내가 실종된 수달을 찾는 걸 도와주든가 아니면 감옥 안에 있는 카페에서 하드나 팔면서 사셔. 이걸 뒤통수 치기라 하지~', 1069, 891, 8),
	(72, '아주 지대로 걸렸네! (긴 호탕한 웃음소리) 정말 완전히 코 꼈어! 넌 경찰이야 닉! 그럼 이게 필요할 거야 토끼랑 재미 많이 보라고! (웃음소리)', 1249, 1075, 10),
	(73, '이제 말해봐.', 1261, 1250, 8),
	(74, '(한숨) 어디 있는지는 나도 모르겠고, 그가 잘 가던 데는 알아.', 1306, 1267, 9),
	(75, '좋아, 가자고!', 1319, 1307, 8),
	(76, '귀엽고 여린 토끼가 갈 만한 그런 곳은 아냐.', 1362, 1330, 9),
	(77, '난 귀엽지 않아. 빨리 타!', 1385, 1364, 8),
	(78, '알았어~ 타라면 타야지.', 1407, 1387, 9),
	(79, '제가 그동안에 오래동안 짱구를 하면서 익숙해져 가니까 이게 행동이나 말이나', 93, 0, 11),
	(80, '(짱구 목소리) 나도모르게 짱구처럼 돼가는거에요', 126, 99, 11),
	(81, '소원을 적은건데?', 12, 0, 12),
	(82, '웅이랑 해피엔딩이길 바래?', 60, 25, 13),
	(83, '응. 아직은 그래. 난 웅이가... 내 인생의 남자 주인공이라 생각했거든. ', 188, 75, 12),
	(84, '미안하지만 웅이는 남자 주인공이 아니야.', 230, 190, 13),
	(85, '뭐? 그럼, 남자 주인공은 누군데?', 283, 240, 12),
	(86, '남자 주인공은 따로 없어. 이 곳의 주인공은 한 명이거든.', 430, 290, 13),
	(87, '(잠에서 깨며)어 출근했니?', 387, 360, 14),
	(88, '밤 샜냐?', 411, 400, 15),
	(89, '그럼, 당직인데 당근 밤 샜지. 밤새 잠 한숨도 못자고', 457, 412, 14),
	(90, '방금 잔건 뭔데?', 472, 458, 15),
	(91, '자다니? 누가? 안잤는데?', 519, 475, 14),
	(92, '(보온병을 주며)너가 좋아하는 토마토 갈아왔어. 살짝 데쳐서 돌렸으니까 대충 먹을만 할거야.', 622, 560, 15),
	(93, '니가 직접? 데치기까지?', 659, 625, 14),
	(94, '응! 내가 직접 데치기까지.', 696, 661, 15),
	(95, '야~ 뭐야~ 아침부터 토마도따위로 사람 감동이나시키고~', 760, 699, 14),
	(96, '이왕 해주는거 이고~ 뚜껑도 같이 따주세요! 네? 아 또잉또잉!', 830, 770, 14),
	(97, '미안하다 내가 잠이 덜깨가지고 혀가 덜풀렸다. 음! 아우 맛있다 신선하다 이거 너무 신선하다. 방금 들은거는 삭제요망, 가능?', 1050, 893, 14),
	(98, '아니, 안가능.', 1072, 1060, 15),
	(99, '아 내가 피곤해가지고 잠깐 에러가 난거라니까. 삭제요망좀 하자~ 어?', 1120, 1075, 14),
	(100, '싫은데? 또잉또잉?', 1148, 1122, 15),
