	(102, '이거 백년짜린데 아니 또잉..', 1182, 1162, 15),
	(103, '고마해라 서우진.', 1195, 1183, 14),
	(104, '또잉또잉? 아 또잉! 알았어 안할게. 또잉또잉', 1254, 1196, 15),
	(105, '아이 진짜!', 1263, 1255, 14),
	(106, '(웃으며)안할게 또잉또잉', 1282, 1268, 15),
	(107, '어..이선웅 선생 인사해 여기는 GS서우진.', 1388, 1340, 14),
	(108, '안녕하십니까. 저 그때 배에서 뵙었습니다.', 1430, 1390, 16),
	(109, '아.. 이번에 새로오신다는 CS펠로우가 그럼..', 1475, 1435, 15),
	(110, '이선웅입니다. 오늘부로 돌담병원에 출근을 명 받았습니다. 김사부님한테요.', 1533, 1477, 16),
	(111, '반갑네요, 앞으로 잘 해봅시다. 또잉또잉.', 1575, 1536, 15),
	(112, '에?', 1588, 1580, 16),
	(113, 'ER콜이다. 그럼 좀이따 보자 차은재선생. 수고해요.', 1708, 1650, 15),
	(114, '고맙다, 와줘서', 78, 48, 17),
	(115, '고맙긴, 당연히 와야지 친구 아버진데.', 108, 79, 18),
	(116, '너 진짜 안회장님 아들이야? 왜 말 안했냐? 누가 뭐 돈이라도 꿔달라 할까봐?', 150, 109, 19),
	(117, '아이 말할 타이밍을 놓쳤어. 미안해 숨기려고 한건 아니고... 아 진짜 말할것도 없어! 나 진짜 개뿔도 없다니까?', 257, 155, 17),
	(118, '그게 더 재수없어', 272, 258, 18),
	(119, '병원은? 그럼 병원은 니가 맡는거야?', 296, 273, 19),
	(120, '병원...', 317, 300, 17),
	(121, '(사이렌 소리)(일동 한숨)허우.. 애떨어져 죽는줄 알았네', 365, 320, 19),
	(122, '심장 터질뻔했어..', 379, 367, 20),
	(123, '야 의사 티내냐? 벨소리 뭐냐?', 397, 380, 19),
	(124, '아..ㅎ', 403, 398, 17),
	(125, '야 너 그리고 심장 터지는게 얼마나 무서운일인데 그런말을 함부로 하냐?', 434, 404, 19),
	(126, '그럼너는 애떨어지는게 얼마나 슬픈 일인데 함부로 애떨어진다는 말을해? 넌 보면 진짜.. 부성애가 없어', 497, 435, 20),
	(127, '야야 그만들좀해라 진짜 머리 깨지겠다.', 528, 498, 17),
	(128, '머리가 깨지다니 너 그럼 죽어', 556, 529, 18),
	(129, '(한숨)', 575, 558, 17),
	(130, '정원아 저 작은아버지 오셨어.', 609, 577, 21),
	(131, '아, 그래?', 623, 615, 17),
